import React from 'react'

function Pagination({onPrev, onNext, prev, next}) {
    const handlePrev = () => {
        onPrev();
    }
    const handleNext = () => {
        onNext();
    }
    return (
        <div className='pagination'>
            {}
        <button onClick={handlePrev}>Previous</button>
        <button onClick={handleNext}>Next</button>
      </div>
    );
}

export default Pagination
